        max={10}
        min={1}
        defaultValue={defaultKP}
        value={TuningData.KP}
        size="small"
        valueLabelDisplay="on"
        onChange={(e) => {
            onUserChangeTuningData({ KP: e.target.value })
        }}
    />
}

export default Monitor;
